import React from "react";

function Contact() {
  return (
    <div>
      <p>
        Hello {firstName} {lastName}
      </p>
      <form className="form">
        <input
          value={firstName}
          name="firstName"
          // onChange={handleInputChange}
          type="text"
          placeholder="First Name"
        />
        <input
          value={lastName}
          name="lastName"
          // onChange={handleInputChange}
          type="text"
          placeholder="Last Name"
        />
        <button type="button">Submit</button>
      </form>
    </div>
  );
}

export default Contact;
